import <print>;
auto main(int argc, char** argv) -> int {
std::println("Hello, World!");
return 0;
}
Как я уже говорил ранее, даже самая базовая и простая программа, используемая для знакомства с языками программирования, содержит в себе много концепций и сущностей, которые надо в какой-то мере осознать, чтобы получить большее понимание языка.
Такое резкое и жестокое закидывание в ураган информации, пусть и болезненно, но поможет более эффективно освоить язык в дальнейшем. Так как назначение сложных вещей уже будет в какой-то мере осознано, будет возникать меньше вопросов и сложностей с восприятием новых конструкций.
Таким образом, цель в том, чтобы дать почувствовать масштаб языка и построить маленький островок, с которого можно двигаться дальше.
В следующих лекциях будут более подробно разобраны основы языка, начиная от самых простых деталей. Но происходить это будет в довольно быстром темпе. Эта лекция уже позволит отталкиваться от нее, чтобы лучше понять материал.
